INSERT INTO `tbl_ques` (`ques_id`, `questions`, `section`) VALUES
(1, 'Demonstrates sensitivity to students\' ability to attend and absorb content information.', 1),
(2, 'Integrates sensitively his/her learning objectives with those of the students in a collaborative process.', 1),
(3, 'Makes self available to students beyond times.', 1),
(4, 'Regularly comes to class on time, well-groomed and well-prepared to complete assigned responsibilitieses.', 1),
(5, 'Keeps accurate records of students\' performance and prompt submission of the same.', 1),
(6, 'Demonstrates mastery of the subject matter (explain the subject matter without relying solely on the prescribed textbook).', 2),
(7, 'Draws and share information on the state on the art of theory and practice his/her discipline.', 2),
(8, 'Integrates subject to practical circumstances and learning intents/purposes of students.', 2),
(9, 'Explains the relevance of present topics to the previous lessons, and relates the subject matter to relevant current issues and/or daily life activities.', 2),
(10, 'Demonstrates up-to-date knowledge and/or awareness on current trends and issues of the subject.', 2),
(11, 'Creates teaching strategies that allow students to practice using concepts they need to understand (interactive discussion).\r\n', 3),
(12, 'Enhances student self-esteem and/or gives due recognition to students\' performance/potentials.', 3),
(13, 'Allows students to create their own course with objectives and realistically defined student-professor rules and make them accountable for their performance.', 3),
(14, 'Allows students to think independently and make their own decisions and holding them accountable for their performance based largely on their success in executing decisions.', 3),
(15, 'Encourages students to learn beyond what is required and help/guide the students how to apply the concepts learned.', 3),
(16, 'Creates opportunities for intensive and/or extensive contribution of students in the class activities (e.g. breaks class into dyads, triads or buzz/task groups).', 4),
(17, 'Assumes roles as facilitator, resource person, coach, inquisitor, integrator, referee in drawing students to contribute to knowledge and understanding of the concepts at hands.', 4),
(18, 'Designs and implements learning conditions and experience that promotes healthy exchange and/or confrontations.', 4),
(19, 'Structures/re-structures learning and teaching-learning context to enhance attainment of collective learning objectives.\r\n', 4),
(20, 'Use of instructional materials (audio/video materials: fieldtrips, film showing, computer aided instruction and etc.) to reinforces learning processes.', 4);
